import React, {Component} from 'react'
import { useState, useEffect } from 'react'

import axios from 'axios'

export default function Search () {
        let [catSearch, updateCatSearch] = useState([])

        const apiCall = async () => {
            const data = await axios(`https://api.thecatapi.com/v1/images/search?limitapi_key=${process.env.REACT_APP_API_KEY}`)
            console.log(data.data[0].url)
            updateCatSearch(data.data[0].url)
            }

        useEffect(() => {
            apiCall()
        }, [])


    return (<>
        <input type="text" placeholder="search"></input>
        <button>Search</button>
    </>)
}






